import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./listingitem.scss";

export class ListingItem extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="main-item">
        <div className="row">
          <div className="col-lg-5">pic</div>
          <div className="col-lg-7">
            <div className="row">181 Lester St. 700 bones</div>
            <div className="row">j6chiang</div>
            <div className="row">number of shits</div>
          </div>
        </div>
      </div>
    );
  }
}
